import Checkout from "./Checkout";
import Subtotal from './Subtotal'
import CheckoutProduct from "./CheckoutProduct";

function App() {
  return (
    // BEM
    <Router>
      <div className="app">
        <Header />
        <Switch>
          <Route path='/order'></Route>
          <Route path="/checkout">

            <Checkout />
            <CheckoutProduct/>

          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>

    /*Home*/
  );
}

export default App;
